import React from "react";
import { CustomButtonContainer } from "./custom-button.styles";

const CustomButton = ({ props }) => (
  <button
    className={`${inverted ? "inverted" : ""} 
						${isGoogleSignIn ? "google-sign-in" : ""} custom-button`}
    {...otherProps}
  >
    {children}
  </button>
);

export default CustomButton;
